import React from 'react';
import { Route, Link } from 'react-router-dom'

const AnimeList = ({anime}) => {
    return (

      <tr>
        <Link to={"/"+ anime.title}>
          <img className="poke-image" width="100px"/>
        </Link>
          <td>{anime.title}</td>
          <td>{anime.category}</td>
      </tr>


    )
}

export default AnimeList;
